  private Token normalizeMultiDots(final String token) {
    if (ptb3Ldots) {
      return makeToken(ptbMultiDots);
    } else if (unicodeLdots) {
      return makeToken(unicodeMultiDots);
    } else {
      return makeToken(token);
    }
  }
  
